import React from 'react';
import ReactDOM from 'react-dom';

const role = 'Front-End Developer';
const salary = 5000;
ReactDOM.render(
  <>
    <h1>Gangadhar is a {role}</h1>
    <p>Salary is {salary}.</p>
  </>,
  document.getElementById('root')
);
